def remote_request(u, dest):
    url = dest.format(u)
    print("Fetching from", url)

    r1 = requests.get(url)

    r = flask.Response(r1,
                       mimetype=r1.headers['content-type'],
                       status=r1.status_code)
    r.headers.add('Access-Control-Allow-Origin', '*')
    r.headers.add('Access-Control-Allow-Headers', 'Content-Type,Authorization')
    r.headers.add('Access-Control-Allow-Methods', 'GET,POST')
    return r


def remote_json_request(u, dest):
    if u not in cache:
        url = dest.format(u)
        print("Fetching from", url)

        r = requests.get(url)

        try:
            cache[u] = r.json()
        except Exception as e:
            print(e)
            raise

    r = flask.jsonify(cache[u])
    r.headers.add('Access-Control-Allow-Origin', '*')
    r.headers.add('Access-Control-Allow-Headers', 'Content-Type,Authorization')
    r.headers.add('Access-Control-Allow-Methods', 'GET,POST')
    return r


@app.route('/api/v1.0/<path:u>')
def unigene(u):
    return remote_json_request(u, 'http://gmgc.embl.de/api/v1.0/{}')


@app.route('/<path:u>')
def website(u):
    return remote_request(u, 'http://127.0.0.1:8000/{}')


